import { BrowserRouter } from "react-router-dom";

import "./App.scss";

import Navbar from "../../components/Navbar";
import Search from "../../components/Search/Search";
import Footer from "../../components/Footer";

import Routes from "../../routes";




  const App = () => (



    <div data-testid="app">
      <BrowserRouter>



      <Navbar  />

        <Routes />

        <Footer />
      </BrowserRouter>
    </div>
  );

  export default App;
